import React, { Component } from 'react';
import html from './portfolio.html';
var template = { __html: __html };


class Portfolio extends Component {


  render() {
    return (
    <div dangerouslySetInnerHTML={{_html : html}} />
    );
  }
}

export default Portfolio;
